SET NAMES utf8mb4;

SET FOREIGN_KEY_CHECKS = 0;

-- tagテーブルの作成
DROP TABLE IF EXISTS tag;

CREATE TABLE tag (
    tag_type VARCHAR(20) NOT NULL COMMENT 'タグ種別',
    tag_no INT NOT NULL COMMENT '----',
    tag_name VARCHAR(20) DEFAULT NULL COMMENT '省略名',
    hit_csv VARCHAR(191) DEFAULT NULL COMMENT '検索ヒット用語（CSV）',
    order_no INT DEFAULT NULL COMMENT '並び順（ASC）[Admin用]',
    parent_no INT DEFAULT NULL COMMENT 'コンポジットパターン',
    enabled TINYINT DEFAULT 1 COMMENT '論理削除フラグ',
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP COMMENT '作成日時',
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新日時',
    PRIMARY KEY (tag_type, tag_no)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

START TRANSACTION;


COMMIT;

SET FOREIGN_KEY_CHECKS = 1;